Amy is at her bosses house picking up a folder for her, when she is surprised by Tommy, her bosses husband. He is there with flowers and says &quot;happy anniversary&quot; before realizing that it has Amy. He grills her on whether his wife talks about their anniversary, but Amy says she never mentioned it once. Now Tommy is bummed, and just gives Amy the flowers. He took the rest of the day off, he needs some cheering up, Amy looks smoking hot.....he has just convinced himself to do a little cheating. And of course Amy is a sucker for a married man who gives her flowers
